import React from 'react';
import './index.css'; 
import company from './company.png';
import about from './about.png';
const About = () => {
    return (
        <div className="about-container">
            <div className="about-content">
                <h5>ABOUT US</h5><img src={about} alt="About" />
                <h1>Discover Writo Education</h1>
                <p>Connecting you with top educators for 
                personalized, real-time support.</p>
                <ul>
                    <li>Access to educators from IITs and NITs.</li>
                    <li>Real-time answers to your questions.</li>
                    <li>Tailored guidance to suit your needs.</li>
                    <li>Holistic learning and support.</li>
                </ul>
            </div>
            <div className="about-image">
                <img src={company} alt="Company" />
            </div>
        </div>
    );
};

export default About;
